import React from 'react';
import { Link } from 'react-router-dom';
import img from "../images/logo_book.png"

const Navbar = () => {
    return (
        <>
            <img src={img} className='logo' />
            <nav className="navbar">
                <Link to="/">Home</Link>
                <Link to="/wishlist">Wishlist</Link>
            </nav>
        </>
    );
};

export default Navbar;
